import React from "react";
import University from "../models/University";
import "./Details.css";

interface DetailsProps {
  university: University;
}

const Details: React.FC<DetailsProps> = ({ university }) => {
  return (
    <div className="details-container">
      <h1 className="details-title">{university.name}</h1>
      <p className="details-info">
        <strong>Country:</strong> {university.country}
      </p>
      <p className="details-info">
        <strong>Web Pages:</strong> {university.web_pages.join(", ")}
      </p>
      <p className="details-info">
        <strong>Domains:</strong> {university.domains.join(", ")}
      </p>
    </div>
  );
};

export default Details;
